// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/// @title AgroChain - Comercio justo para agricultores usando blockchain
/// @notice Permite publicar productos, recibir financiamiento y liberar pagos tras la entrega
contract AgroChain {

    /// @notice Estados posibles de un producto
    enum Estado {
        Publicado,    // Producto publicado y esperando financiamiento
        Financiado,   // Producto financiado por un comprador
        Enviado,      // Producto enviado por el agricultor (opcional)
        Recibido      // Producto recibido y confirmado, pago liberado
    }

    /// @notice Estructura que representa un producto agrícola
    struct Producto {
        string nombre;                  // Nombre del producto (ej: café, papa)
        uint precio;                    // Precio en wei (1 ETH = 10^18 wei)
        address payable agricultor;     // Dirección del agricultor (dueño y receptor del pago)
        address comprador;              // Dirección del comprador
        Estado estado;                  // Estado actual del producto
    }

    /// @notice Mapping de productos por ID
    mapping(uint => Producto) public productos;

    /// @notice Contador global de productos (sirve como ID incremental)
    uint public contador = 0;

    /// @notice Permite a un agricultor publicar un nuevo producto
    /// @param _nombre Nombre del producto
    /// @param _precio Precio en wei (ej: 1 ETH = 1e18 wei)
    function publicarProducto(string memory _nombre, uint _precio) public {
        productos[contador] = Producto({
            nombre: _nombre,
            precio: _precio,
            agricultor: payable(msg.sender),  // el agricultor es quien llama a la función
            comprador: address(0),            // sin comprador aún
            estado: Estado.Publicado
        });

        contador++; // Incrementa el contador de productos
    }

    /// @notice Permite a un comprador financiar la compra del producto
    /// @param _id ID del producto a financiar
    function financiarCompra(uint _id) public payable {
        Producto storage p = productos[_id];

        require(p.estado == Estado.Publicado, "El producto ya fue financiado o entregado");
        require(msg.value == p.precio, "El valor enviado no coincide con el precio");

        p.comprador = msg.sender;
        p.estado = Estado.Financiado;
    }

    /// @notice Confirmación del comprador de que recibió el producto
    /// @param _id ID del producto recibido
    function confirmarEntrega(uint _id) public {
        Producto storage p = productos[_id];

        require(msg.sender == p.comprador, "Solo el comprador puede confirmar");
        require(p.estado == Estado.Financiado, "El producto no ha sido financiado");

        p.estado = Estado.Recibido;

        // Transfiere el pago al agricultor
        p.agricultor.transfer(p.precio);
    }

    //
}

